import APIInformation from '../componentsAPIInformation'
import AlbumInfoContainer from 'AlbumInfoContainer'


import React from 'react'

export class DemoContainer extends React.Component {

  constructor(props) {
     super(props);
     this.state = {
       album: [],
       tracks: []
     };
   }

  render() {
    return (
    <div>
    <h1>@</h1>
      <APIInformation />
      <AlbumInfoContainer />
    </div>
  )
}

}
export default DemoContainer;
